Manga Watcher v0.5.18
Requirements: Android OS 1.5 +
Overview: The Best Manga Reader for Android

Read your favorite manga on your phone. You can read online or download and read later. You can open your manga from sdcard (png, jpg, zip). Share in Facebookand Twitter. Read manga fromhttp://www.mangareader.net and etc. Read the manga in English, French, Russian, Spanish, German and Arabic. 
Have multitouch and one finger zoom!

What's in this version:
fix problem with Nook Color;
fix problem with Batoto.com (Batoto.net);
fix starting problem;
redesign app;
remove Mangatoshokan and Doujintoshokan because sites in down a couple weeks;
bug fix;
